import React, { useState, useEffect } from "react";
import Tuscany from '../DB/Tuscany.json';

// Import icons (uncomment as needed)
import drtn from '../assets/home/icons/icons_tours/duration.svg';
import lctn from '../assets/home/icons/location.svg';
import gd from '../assets/home/icons/icons_tours/guide.svg';
import ln from '../assets/home/icons/icons_tours/language.svg';
import fs from '../assets/home/icons/icons_tours/ticket.svg';
// ... other imports

export default function SpecificTour ({ id }) {
  const [selectedTour, setSelectedTour] = useState(null); // Use null as initial state

  useEffect(() => {
    const foundTour = Tuscany.find(tour => tour.id === Number(id));
    setSelectedTour(foundTour);
  }, [id, Tuscany]);

  return (
    <section>
      {selectedTour ? (
        <section>
          <section key={selectedTour?.id}>  {/* Optional key for safety */}
            <img src={selectedTour.img} alt={selectedTour.title} />
            <h3>{selectedTour.title}</h3>
            <section className="price">
              <p>from <p>{selectedTour.price}</p></p>
            </section>
            <p>{selectedTour.short_description}</p>
            <label>Date</label>
            <section className="date-picker">
              <DatePicker />
            </section>
            <label>Time</label>
            {/* ... Time selection section ... */}
            <button>Buy Now</button>
            <section>
              <h3>Details</h3>
              <p>{selectedTour.details}</p>
              <section>
                {/* Uncomment and update tour properties */}
                {/* <img src={grp} alt="numberOfPeople" /> <p> Number of group:{selectedTour.people}</p> */}
                <section>
                  <img src={drtn} alt="Duration of tour" />
                  <p> Duration: {selectedTour.duration}</p>
                </section>
                <section>
                  <img src={lctn} alt="Departing from" />
                  <p> Departuring and arriving areas: {selectedTour.departure}</p>
                </section>
                {/* ... other tour details ... */}
              </section>
            </section>
          </section>
        </section>
      ) : (
        <p>Tour not found or data is loading...</p>
      )}
    </section>
  );
}
